import React from 'react';
import { Grid, Image, Button, Header } from 'semantic-ui-react';

const ListingPage = ({ listing }) => {
  return (
    <Grid>
      <Grid.Row>
        <Image src={listing.images[0]} />
      </Grid.Row>
      <Grid.Row>
        <Header>
          {listing.game}
          <Header.Subheader content={listing.description} />
        </Header>
      </Grid.Row>
    </Grid>
  );
};

export default ListingPage;
